import React from "react";
import { Typography } from "antd";
const { Text } = Typography;
const HeaderTitle = () => {
  title = label => {
    label: [{ Order: "OrderMenu" }];
  };
  return (
    <div style={{ textAlign: "center" }}>
      <Text strong style={{ fontSize: "50px" }}>
        {title}
      </Text>
    </div>
  );
};

export default HeaderTitle;
